int numberOfContacts;
List<RaycastHit2D> contacts = new List<RaycastHit2D>();
numberOfContacts = Physics2D.BoxCast(
    m_collider.bounds.center,
    m_collider.bounds.size,
    0f,
    Vector2.down,
    contactFilter,
    contacts,
    // /!\
    // This distance must be strictly greater than:
    // Edit > Project Settings... > Physics 2D > Default Contact Offset
    // which is currently 0.01, otherwise some contacts may be missed.
    // /!\
    0.011f );
